CREATE TABLE games(   id int not null GENERATED ALWAYS AS IDENTITY (START WITH 1, INCREMENT BY 1),   home   VARCHAR(25) NOT NULL   ,visitor VARCHAR(25) NOT NULL  ,theyear   INTEGER  NOT NULL  ,scorehome INTEGER  NOT NULL  ,scorevisitor INTEGER  NOT NULL  ,winner INTEGER  NOT NULL,  primary key (id))
